import React from "react";
import "bootstrap/dist/css/bootstrap.css"
const Table = ({ data }) => {
    return (
        <table className='table table-striped table-dark'>
            <tbody>
                <tr>
                    <th>customerID</th>
                    <th>companyName</th>
                    <th>contactName</th>
                    <th>contactTitle</th>
                    <th>address</th>
                    <th>city</th>
                    <th>region</th>
                </tr>
                {data.map((item, i) => (
                    <tr key={i}>
                        <td></td>
                    </tr>
                ))}

            </tbody>
        </table>
    )
}
export default Table;
